import React from "react";
import axios from 'axios';
import { Button, FormGroup, Form } from "react-bootstrap";


class Login extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            user: "",
            password: "",
            greeting: ""
        }
        this.handleClick = this.handleClick.bind(this);
    }

    handleClick() {
        this.setState({greeting: `Привет, ${this.state.user}`})
        axios.post(("http://localhost:8080/api/v1/auth/authenticate"), {
            "email": this.state.user,
            "password": this.state.password
        }).then(response => console.log(response))
        .catch(error => console.log(error))
      }

  render () {
    return (
      <>
        <h1>Вход</h1>
        <label htmlFor="login">Логин</label>
        <input className="auth" id="login" type="text" placeholder="Например: ivanov@mail.ru" title="email"
            />
        <label htmlFor="login">Пароль</label>
        <input className="auth" id="password" type="password" placeholder="Например: admin1234" title="pass"
             />
        <Form>
          <FormGroup className="m-3">
            <Form.Label htmlFor="emailInput">Email: </Form.Label>
            <Form.Control type="email" id="emailInput" placeholder="Ivanov@mail.rur" onChange={(event) => this.setState({user: event.target.value})}></Form.Control>
          </FormGroup>
          <FormGroup className="m-3">
            <Form.Label htmlFor="passwordInput">Email: </Form.Label>
            <Form.Control type="password" id="passwordInput" placeholder="От 8 цифр" onChange={(event) => this.setState({password: event.target.value})}></Form.Control>
          </FormGroup>
        </Form>
        <Button className="mr-3" variant ="outline-primary" onClick={this.handleClick}>Жмит!</Button>
        <div>{this.state.greeting}</div>
      </>
    )
  }  
}

export default Login;
